import React from 'react';
import Container from 'react-bootstrap/Container';
import { FormBody } from '../Context/context';
import Logo from '../Pictures/bank.png';

function Home() {
    return (
        <Container class="row align-items-center justify-content-center">
            <div class="col">
            <FormBody
                bgcolor="primary"
                txtcolor="white"
                header="BadBank Landing Page"
                title="Welcome to the bank"
                text="You can use this bank"
                body={<img src={Logo} className="img-fluid" alt="Responsive image" />}
            />
            </div>
        </Container>
    );
};

export default Home
